g\",\"isOwnerViewing\":false,\"shortDescription\":\"Did Bob Lazar actually work on recovered alien spacecraft at Area 51 for the U.S. Government? Were going to analyze his body language to find out.\\n\\nBob Lazar claims to be a scientist who worked on alien spacecraft at Area 51 (S4) for the U.S. Government in the late 1980s.\\n\\nEspecially for this video, its important for you to know if I have any biases going into this. Ive never seen a UFO or aliens, but, like many, I believe were probably not completely alone in the universe. Prior to doing this analysis, havent heard of Bob Lazar and when I did, thought hes at least a little deceitful because his story is so extraordinary. \\n\\nWhats interesting is that over the past few years, the U.S. Government has become more open to admitting the existence of this UFO stuff. Interesting that the U.S. Government isnt completely ignoring these claims anymore.  Probably because when something odd is seen, it can now be easily recorded since cameras are everywhere, and once its recorded, the internet can spread it across the world in seconds.\\n\\nWhats interesting about all this is someones lying, its either the U.S. Government for totally hiding and covering all this up or its Bob Lazar. So were going to put our neutral hats on to analyze Bob Lazars body language, piece together his story, and review the evidence to find out if he is truthful or just lying.\\n\\nNow in the comments, why do you think the U.S. Government seems to be trying to hide all this from us? Let everyone know in the comments below.\\n\\nGive this video a THUMBS UP if you think were NOT ALONE in the universe.\\n\\nGive this video a THUMBS DOWN if you think were COMPLETELY ALL ALONE in the universe.\\n\\nRemember to subscribe so you dont miss out on new body language and investigative videos where we always seem to shake up YouTube, and Ill see you at the top.\\n\\n#BobLazar #Area51 #BodyLanguage\\n\\nMy Vlog Channel:\\nhttps:\/\/www.youtube.com\/chan  this up or its Bob Lazar. So were going to put our neutral hats on to analyze Bob Lazars body language, piece together his story, and review the evidence to find out if he is truthful or just lying.\n\nNow in the comments, why do you think the U.S. Government seems to be trying to hide all this from us? Let everyone know in the comments below.\n\nGive this video a THUMBS UP if you think were NOT ALONE in the universe.\n\nGive this video a THUMBS DOWN if you think were COMPLETELY ALL ALONE in the universe.\n\nRemember to subscribe so you dont miss out on new body language and investigative videos where we always seem to shake up YouTube, and Ill see you at the top.\n\n"},{"text":"#BobLazar","navigationEndpoint":{"clickTrackingParams":"CJcBENzXBCITCPCbpvjImOoCFRcQ8QUd5XoJBw==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23BobLazar","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#BobLazar"}},"loggingDirectives":{"trackingParams":"CJcBENzXBCITCPCbpvjImOoCFRcQ8QUd5XoJBw==","visibility":{"types":"12"}}},{"text":" "},{"text":"#Area51","navigationEndpoint":{"clickTrackingParams":"CJYBENzXBCITCPCbpvjImOoCFRcQ8QUd5XoJBw==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23Area51","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#Area51"}},"loggingDirectives":{"trackingParams":"CJYBENzXBCITCPCbpvjImOoCFRcQ8QUd5XoJBw==","visibility":{"types":"12"}}},{"text":" "},{"text":"#BodyLanguage","navigationEndpoint":{"clickTrackingParams":"CJUBENzXBCITCPCbpvjImOoCFRcQ8QUd5XoJBw==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23BodyLanguage","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#BodyLanguage"}},"loggingDirectives":{"trackingParams":"CJUBENzXBCITCPCbpvjImOoCFRcQ8QUd5XoJBw==","visibility":{"types":"12"}}},{"text":"\n\nMy Vlog Channel:\n"},{"text":"https://www.youtube.com/channel/UCGof...","navigationEndpoint":
